def startSound():
    a = ""

    pygame.init()
    pygame.mixer.init()

    mp3_data = base64.b64decode(a)

    mp3_file = BytesIO(mp3_data)

    pygame.mixer.music.load(mp3_file)
    pygame.mixer.music.play()

    while pygame.mixer.music.get_busy() == True:
        continue

    pygame.mixer.quit()

def SplashScreen():
    w=Tk()

    width_of_window = 427
    height_of_window = 250
    screen_width = w.winfo_screenwidth()
    screen_height = w.winfo_screenheight()
    x_coordinate = (screen_width/2)-(width_of_window/2)
    y_coordinate = (screen_height/2)-(height_of_window/2)
    w.geometry("%dx%d+%d+%d" %(width_of_window,height_of_window,x_coordinate,y_coordinate))

    w.overrideredirect(1)

    s = ttk.Style()
    s.theme_use('clam')
    s.configure("red.Horizontal.TProgressbar", foreground='red', background='#4f4f4f')
    progress=Progressbar(w,style="red.Horizontal.TProgressbar",orient=HORIZONTAL,length=500,mode='determinate',)

    def bar():
        ssa = threading.Thread(target=startSound, args=[])
        ssa.start()

        l4=Label(w,text='Loading...',fg='white',bg=a)
        lst4=('Calibri (Body)',10)
        l4.config(font=lst4)
        l4.place(x=18,y=210)
        
        import time
        r=0
        for _ in range(200):
            progress['value']=r
            w.update_idletasks()
            time.sleep(0.03)
            r=r+1
        
        w.destroy()
        g = threading.Thread(target=Start, args=[])
        g.start()
            
    progress.place(x=-10,y=235)

    a = '#1F6AA5'
    Frame(w,width=427,height=241,bg=a).place(x=0,y=0)  #249794
    b1=Button(w,width=10,height=1,text='Get Started',command=bar,border=0,fg=a,bg='white')
    b1.place(x=170,y=200)

    l1=Label(w,text='YouTube',fg='white',bg=a)
    lst1=('Calibri (Body)',20,'bold')
    l1.config(font=lst1)
    l1.place(x=230,y=77)#place(x=50,y=80)
    
    pls = ""
    #img = ImageTk.PhotoImage(Image.open("logo small.png"))
    img = PhotoImage(data=pls)

    panel = Label(w, image=img, width=150,height=150)
    panel.place(x=63,y=25)#place(x=230,y=25)

    l3=Label(w,text='Visualizer',fg='white',bg=a)
    lst3=('Calibri (Body)',15)
    l3.config(font=lst3)
    l3.place(x=230,y=110)#place(x=50,y=110)

    w.mainloop()

if __name__ == "__main__":
    import threading
    t = threading.Thread(target=SplashScreen, args=[])
    t.start()
    
