def Start():
    global app
    app = window()
    def on_closing():
        if messagebox.askokcancel("Quit", "Do you want to quit?"):
            app.destroy()
            plt.close('all')
    app.protocol("WM_DELETE_WINDOW", on_closing)
    app.mainloop()
    os.kill(os.getpid(), 9)


